import React from "react";

const OccupationField = ({ value, onChange, options }) => (
  <div>
    <label htmlFor="occupation">Occupation:</label>
    <select id="occupation" value={value} onChange={onChange}>
      {options.map(option => (
        <option key={option} value={option}>
          {option}
        </option>
      ))}
    </select>
  </div>
);

export default OccupationField;
